export default function Skills(props) {
  return (
    <main className={styles.main}>
      <div className={styles.imagewrap}>
        <img src={props.imgscr} alt={props.imgName} style={{width:'20px',hei}}/>
      </div>

      <h1>{props.name}</h1>
    </main>
  );
}
